const AWS = require ("aws-sdk");
const docClient = new AWS.DynamoDB.DocumentClient({region:'us-east-1'});
var rekognition = new AWS.Rekognition();
let count = 30
var table = "<table><tr><th>Low</th><th>High</th></tr>";

exports.handler = async(event, context, callback) =>{
  
      var rekognition = new AWS.Rekognition();
//      var string = "data:image/jpeg;base64,"
      // var string = "data:image/jpeg;base64,"
      var string = "data:image/jpeg;base64,"
      var regex = /^data:.+\/(.+);base64,(.*)$/;
      
      var matches = string.match(regex);
      var ext = matches[1];
      var data = matches[2];
      var buffer = new Buffer(data, 'base64');
    
      var params = {
        Image: {
          Bytes: buffer
        },
        Attributes: [
          'ALL',
        ]
      };
      
      rekognition.detectFaces(params, async (err, data) =>{
        if (err){
          table += "</tablee>";
          console.log(err, err.stack); // an error occurred
        }
        else {
          
    //       // show each face and build out estimated age table
          for (var i = 0; i < data.FaceDetails.length; i++) {
            table += '<tr><td>' + data.FaceDetails[i].AgeRange.Low +
              '</td><td>' + data.FaceDetails[i].AgeRange.High + '</td></tr>';
          }
          table += "</table><br/>"
    //       document.getElementById("opResult").innerHTML = table;
            
             
        }
    });

    this.sendToDynamoDB(event, context, callback);
  
}

exports.sendToDynamoDB = async(event,context,callback)=>{

    let scanningParameters =
      {
        TableName: 'orders',
              "Item":{
                  "id": ''+count,
                  "username" : "admin",
                  "quantity" : "1",
                  "project" : "123",
                  // "description": "AWS alexa " 
                  "description": "" + table
                  // "description": "" + event.operation 
              }
      }
     
      docClient.put(scanningParameters,function(err,data)
      {
        if (err) {
          callback(err,null,);
        }
        else {
          callback(null, data);
        }
     
      });
      
      count++
  
    callback(null,event.operation)
  
  
}